DECLARE varTimeID INT;
DECLARE varMD5Email CHAR(32);
DECLARE varLGID INT;
DECLARE varCOLS INT;
DECLARE intINDEX INT;

DECLARE cur1 CURSOR FOR
SELECT time_id
FROM AppleMaps.RAW_AnalystPerformance
WHERE time_id BETWEEN DATE_SUB(CURDATE(), INTERVAL 2 WEEK) AND NOW()
GROUP BY time_id;

DECLARE CONTINUE HANDLER FOR NOT FOUND SET finished = 1;

# LOGIN
INSERT INTO AppleMaps.dim_ap_login(login_dsc)       		
SELECT ap.login
FROM AppleMaps.RAW_AnalystPerformance AS ap
LEFT JOIN AppleMaps.dim_ap_login AS dim
ON MD5(ap.login) = dim.login_md5
WHERE dim.login_md5 IS NULL
GROUP BY MD5(ap.login);
 
 
# LOCALE
INSERT INTO AppleMaps.dim_ap_locale (locale_dsc)       		
SELECT ap.customer_market
FROM AppleMaps.RAW_AnalystPerformance AS ap		
LEFT JOIN AppleMaps.dim_ap_locale AS dim
ON ap.customer_market = dim.locale_dsc
WHERE dim.locale_dsc IS NULL
GROUP BY ap.customer_market;
	       
OPEN cur1;
 
getdata: LOOP
	FETCH cur1 INTO varDay;
    
    IF finished = 1 THEN
		LEAVE getdata;
    END IF;

    CALL AppleMaps.sp_ap_purgeday(varDay);
    
    # FAC_AP
	INSERT INTO AppleMaps.fac_ap (lg_id, loc_id, start_dat, state_enu, tqtotal_int, tqscore_int, tqqualgroups_int, tqdisqualgroups_int, 
		qweighted_int, dqweighted_int, tqperfstraight_int, tqperfweighted_int, time_id)
    
	SELECT log.lg_id, loc.lo_id, ap.START_DATE, ap.StateEnu, ap.TotalTQ, ap.TQScore, ap.QualifiedTQgroups, ap.DisqualifiedTQgroups,
		ap.WeightedQ, ap.WeightedDQ, ap.TQperformancestraight, ap.TQperformanceweighted, ap.time_id
	
	FROM AppleMaps.RAW_AnalystPerformance AS ap    
	
	JOIN AppleMaps.dim_ap_login AS log
	ON MD5(ap.login) = log.login_md5    
	
	JOIN AppleMaps.dim_ap_locale AS loc
	ON ap.customer_market = loc.locale_dsc;


	# QUALIFIED 
	QPG: BEGIN
		DECLARE cur2 CURSOR FOR
		SELECT Qualifiedprojectgroups, IFNULL(ROUND(LENGTH(QualifiedProjectGroups) - LENGTH(REPLACE(Qualifiedprojectgroups, ',', "")) / LENGTH(","),0) + 1, 1) AS cols_int 
		FROM AppleMaps.RAW_AnalystPerformance
        GROUP BY Qualifiedprojectgroups;
	
		OPEN cur2;
			
