			FETCH cur2 INTO varQualProjGroup, varCOLS;
			
            SET intINDEX = 1;
            
			IF finished = 1 THEN
				LEAVE getdata2;
			END IF;
            
            WHILE intINDEX <= varCOLS DO     
                INSERT INTO AppleMaps.dim_ap_projectgrpsqual (projectgrpqual_dsc)
				SELECT main.pgq_md5
				FROM
				(
					SELECT IFNULL(TRIM(SUBSTRING_INDEX(SUBSTRING_INDEX(varQualProjGroup, ',', intINDEX), ',', -1)), '') AS pgq_md5
				) AS main
                LEFT JOIN AppleMaps.dim_ap_projectgrpsqual AS pgq
				ON MD5(main.pgq_md5) = pgq.pgq_md5
                WHERE pgq.pgq_id IS NULL;                                                                                                
				SET intINDEX = intINDEX + 1;
			END WHILE;		
            
		END LOOP getdata2;   
		CLOSE cur2 ;
		SET finished = 0;
	END QPG;


    # DISQUALIFIED UNIQUE VALUES
	DPG: BEGIN
		DECLARE cur3 CURSOR FOR
		SELECT Disqualifiedprojectgroups, IFNULL(ROUND(LENGTH(DisqualifiedProjectGroups) - LENGTH(REPLACE(Disqualifiedprojectgroups, ',', "")) / LENGTH(","),0) + 1, 1) AS cols_int 
