					SELECT IFNULL(TRIM(SUBSTRING_INDEX(SUBSTRING_INDEX(varDisQualProjGroup, ',', intINDEX), ',', -1)), '') AS pgdq_md5
				) AS main
                LEFT JOIN AppleMaps.dim_ap_projectgrpsdisqual AS pgdq
				ON MD5(main.pgdq_md5) = pgdq.pgdq_md5
                WHERE pgdq.pgdq_id IS NULL;                                                                                                
				SET intINDEX = intINDEX + 1;
			END WHILE;			
            
		END LOOP getdata3;   
		CLOSE cur3 ;
		SET finished = 0;
	END DPG;
  
  
    # QUALIFIED BY USER, DATE
    INS: BEGIN
		DECLARE cur4 CURSOR FOR
		SELECT log.lg_id, ap.Qualifiedprojectgroups, ap.time_id,         
        IFNULL(ROUND(LENGTH(ap.Qualifiedprojectgroups) - LENGTH(REPLACE(ap.Qualifiedprojectgroups, ',', "")) / LENGTH(","),0) + 1, 1) AS cols_int        
		FROM AppleMaps.RAW_AnalystPerformance AS ap    
		JOIN AppleMaps.dim_ap_login AS log
		ON MD5(ap.login) = log.login_md5;
                   		
		OPEN cur4;
			
		getdata4: LOOP
			FETCH cur4 INTO varLGID, varQualProjGroup, varDay, varCOLS;
			
            SET intINDEX = 1;
            
			IF finished = 1 THEN
				LEAVE getdata4;
			END IF;

			WHILE intINDEX <= varCOLS DO     
                INSERT INTO AppleMaps.fac_ap_projectgrpsqual (lg_fk, pgq_id, time_id)
				SELECT varLGID, pgq.pgq_id, varDay
				FROM
				(
					SELECT varLGID, MD5(IFNULL(TRIM(SUBSTRING_INDEX(SUBSTRING_INDEX(varQualProjGroup, ',', intINDEX), ',', -1)), '')) AS pgq_md5, varDay
				) AS main
                JOIN AppleMaps.dim_ap_projectgrpsqual AS pgq
				ON main.pgq_md5 = pgq.pgq_md5;                                                                                                
				SET intINDEX = intINDEX + 1;
			END WHILE;  
            
        END LOOP getdata4;   
		CLOSE cur4 ;
		SET finished = 0;
	END INS;

    # DISQUALIFIED BY USER, DATE
    DIS: BEGIN
		DECLARE cur5 CURSOR FOR
		SELECT log.lg_id, ap.Disqualifiedprojectgroups, ap.time_id,         
        IFNULL(ROUND(LENGTH(ap.Disqualifiedprojectgroups) - LENGTH(REPLACE(ap.Disqualifiedprojectgroups, ',', "")) / LENGTH(","),0) + 1, 1) AS cols_int        
		FROM AppleMaps.RAW_AnalystPerformance AS ap    
		JOIN AppleMaps.dim_ap_login AS log
		ON MD5(ap.login) = log.login_md5;
                   		
		OPEN cur5;
			
		getdata5: LOOP
			FETCH cur5 INTO varLGID, varDisQualProjGroup, varDay, varCOLS;
			
            SET intINDEX = 1;
            
