				) AS main
                JOIN AppleMaps.dim_ap_projectgrpsdisqual AS pgdq
				ON main.pgdq_md5 = pgdq.pgdq_md5;                                                                                                
				SET intINDEX = intINDEX + 1;
			END WHILE;

        END LOOP getdata5;   
		        
        CLOSE cur5 ;
	
	SET finished = 0;
	END DIS;
  
END LOOP getdata;   
CLOSE cur1 ;

