CREATE DEFINER=`ETL_Admin`@`%` PROCEDURE `sp_ap_purgeday`(date_dat DATE)
BEGIN

DELETE FROM AppleMaps.fac_ap WHERE time_id = date_dat;
DELETE FROM AppleMaps.fac_ap_projectgrpsqual WHERE time_id = date_dat;
DELETE FROM AppleMaps.fac_ap_projectgrpsdisqual WHERE time_id = date_dat;

DELETE FROM AppleMaps.fac_ap WHERE time_id < DATE_SUB(CURDATE(), INTERVAL 2 WEEK);
DELETE FROM AppleMaps.fac_ap_projectgrpsqual WHERE time_id < DATE_SUB(CURDATE(), INTERVAL 2 WEEK);
DELETE FROM AppleMaps.fac_ap_projectgrpsdisqual WHERE time_id < DATE_SUB(CURDATE(), INTERVAL 2 WEEK);

END ;;
