ON dpd.TestQuestionTaskType_MD5 = dim.md5_dsc
WHERE dim.md5_dsc IS NULL
GROUP BY dpd.TestQuestionTaskType_MD5;  


		
# DETAILED PAYMENTS
INSERT INTO AppleMaps.fac_dpd (r_id, re_id, c_id, cn_id, tt_id, pl_id, l_id, resultsnumber_int, resultszero_int, resultstotal_int, 
	ert_int, projectid_int, start_dat, finish_dat, pststart_dat, pstfinish_dat, art_int, requestid_int, 
	tp_id, tid_id, testquestion_int, replayid_int, filestart_dat, fileend_dat)    
SELECT r.r_id, re.re_id, c.c_id, cn.cn_id, tt.tt_id, pl.pl_id, l.l_id, dpd.NumberofResults, dpd.NumberofZeroResults, dpd.TotalResults,
	dpd.EstimatedRatingTime, dpd.ProjectID, dpd.StartTime, dpd.FinishTime, dpd.pststart_dat, dpd.pstfinish_dat, dpd.ActualRatingTimeperResult, dpd.RequestID, 
	tp.tp_id, tsk.tsk_id, dpd.TestQuestionSet, dpd.ReplayID, dpd.filename_start, dpd.filename_end
FROM AppleMaps.RAW_DPHourly AS dpd   
JOIN AppleMaps.dim_dpd_concept AS c
ON dpd.Concept_MD5 = c.md5_dsc
JOIN AppleMaps.dim_dpd_conceptname AS cn
ON dpd.ConceptName_MD5 = cn.md5_dsc    
JOIN AppleMaps.dim_dpd_tasktype AS tt
ON dpd.TaskType_MD5 = tt.md5_dsc    
JOIN AppleMaps.dim_dpd_rater AS r
ON dpd.RaterName_MD5 = r.md5_dsc    
JOIN AppleMaps.dim_dpd_rateremail AS re
ON dpd.RaterEmail_MD5 = re.md5_dsc
JOIN AppleMaps.dim_dpd_primarylocale AS pl
ON dpd.PrimaryLocale = pl.primarylocale_dsc
JOIN AppleMaps.dim_dpd_locale AS l
ON dpd.Locale = l.locale_dsc
JOIN AppleMaps.dim_dpd_taskid AS tsk
ON dpd.TaskID_MD5 = tsk.md5_dsc
JOIN AppleMaps.dim_dpd_taskpurpose AS tp
ON dpd.TaskPurpose_MD5 = tp.md5_dsc;



END ;;
