CREATE DEFINER=`ETL_Admin`@`%` PROCEDURE `sp_dp_import`()
BEGIN

DECLARE finished INTEGER DEFAULT 0;
DECLARE varDay INT(11);
DECLARE intEpochStart INT(11);
DECLARE intEpochEnd INT(11);


DECLARE cur1 CURSOR FOR
SELECT DATE_FORMAT(FROM_UNIXTIME(LEFT(RIGHT(filename, 21), 10)), '%Y%m%d'), LEFT(RIGHT(REPLACE(filename, '.csv', ''), 21), 10), RIGHT(REPLACE(filename, '.csv', ''), 10)   
FROM AppleMaps.RAW_DetailedPayments
GROUP BY filename;

DECLARE CONTINUE HANDLER FOR NOT FOUND SET finished = 1;


OPEN cur1;
getdata: LOOP
    FETCH cur1 INTO varDay, intEpochStart, intEpochEnd;
		
    IF finished = 1 THEN
		LEAVE getdata;
    END IF;
		
    CALL AppleMaps.sp_dp_purgeday(varDay);

  
	# RATER
	INSERT INTO AppleMaps.dim_dp_rater (time_id, md5_dsc, name_dsc)       		
	SELECT time_id, MD5(dp.RaterName), dp.RaterName
	FROM AppleMaps.RAW_DetailedPayments AS dp	
	WHERE time_id = varDay
	GROUP BY MD5(dp.RaterName);   
	
 
	# RATER EMAIL
	INSERT INTO AppleMaps.dim_dp_rateremail (time_id, md5_dsc, email_dsc)       		
	SELECT time_id, MD5(dp.RaterEmail), dp.RaterEmail
	FROM AppleMaps.RAW_DetailedPayments AS dp	
	WHERE time_id = varDay
	GROUP BY MD5(dp.RaterEmail);   

 
	# PRIMARY LOCALE
	INSERT INTO AppleMaps.dim_dp_primarylocale (time_id, primarylocale_dsc)       		
	SELECT time_id, dp.PrimaryLocale
	FROM AppleMaps.RAW_DetailedPayments AS dp		
	WHERE time_id = varDay
	GROUP BY dp.PrimaryLocale;   

 
	# LOCALE
	INSERT INTO AppleMaps.dim_dp_locale (time_id, locale_dsc)       		
	SELECT time_id, dp.Locale
	FROM AppleMaps.RAW_DetailedPayments AS dp		
	WHERE time_id = varDay
	GROUP BY dp.Locale;   
    
	# CONCEPT
	INSERT INTO AppleMaps.dim_dp_concept (time_id, md5_dsc, concept_dsc)       		
	SELECT time_id, MD5(dp.Concept), dp.Concept
	FROM AppleMaps.RAW_DetailedPayments AS dp
	WHERE time_id = varDay
	GROUP BY MD5(dp.Concept);   
    
	# CONCEPT NAME
	INSERT INTO AppleMaps.dim_dp_conceptname (time_id, md5_dsc, conceptname_dsc)       		
	SELECT time_id, MD5(dp.ConceptName), dp.ConceptName
	FROM AppleMaps.RAW_DetailedPayments AS dp		
	WHERE time_id = varDay
	GROUP BY MD5(dp.ConceptName);   
       
	# TASK TYPE
    INSERT INTO AppleMaps.dim_dp_tasktype (time_id, md5_dsc, tasktype_dsc)       		
	SELECT time_id, MD5(dp.TaskType), dp.TaskType
    FROM AppleMaps.RAW_DetailedPayments AS dp		
    WHERE time_id = varDay
    GROUP BY MD5(dp.TaskType);   
    
	# TASK ID(S)
    INSERT INTO AppleMaps.dim_dp_taskid (time_id, md5_dsc, taskid_dsc)       		
	SELECT time_id, MD5(dp.TaskIDs), dp.TaskIDs
    FROM AppleMaps.RAW_DetailedPayments AS dp		
    WHERE time_id = varDay
    GROUP BY MD5(dp.TaskIDs);   
    

	
	# DETAILED PAYMENTS
	INSERT INTO AppleMaps.fac_dp (rater_id, rateremail_id, plocale_id, locale_id, concept_id, conceptname_id, tasktype_id, results_int, resultszero_int, resultstotal_int, 
		estratingtime_int, bookid_int, start_dat, finish_dat, actualtime_int, requestid_int, taskpurpose_enu, taskid_id, testqset_int, replay_int, time_id)
	SELECT r.rater_id, re.re_id, pl.pl_id, l.l_id, c.c_id, cn.cn_id, tt.tt_id, dp.NumberofResults, dp.NumberofZeroResults, dp.TotalResults, dp.EstimatedRatingTime, dp.BookId,
		 dp.StartTime, dp.FinishTime, dp.ActualRatingTimeperResults, dp.RequestID, dp.TaskPurpose, ti.tid_id, dp.TestQuestionSet, RIGHT(dp.Replay, 9), dp.time_id
    
    FROM AppleMaps.RAW_DetailedPayments AS dp
    
	JOIN AppleMaps.dim_dp_rater AS r
    ON MD5(dp.RaterName) = r.md5_dsc
    AND dp.time_id = r.time_id
   
   	JOIN AppleMaps.dim_dp_rateremail AS re
    ON MD5(dp.RaterEmail) = re.md5_dsc
    AND dp.time_id = re.time_id
    
	JOIN AppleMaps.dim_dp_primarylocale AS pl
    ON dp.PrimaryLocale = pl.primarylocale_dsc
    AND dp.time_id = pl.time_id
    
    JOIN AppleMaps.dim_dp_locale AS l
    ON dp.Locale = l.locale_dsc
    AND dp.time_id = l.time_id
   
    JOIN AppleMaps.dim_dp_concept AS c
    ON MD5(dp.Concept) = c.md5_dsc
    AND dp.time_id = c.time_id
   
	JOIN AppleMaps.dim_dp_conceptname AS cn
    ON MD5(dp.ConceptName) = cn.md5_dsc
    AND dp.time_id = cn.time_id
   
   	JOIN AppleMaps.dim_dp_tasktype AS tt
    ON MD5(dp.TaskType) = tt.md5_dsc
    AND dp.time_id = tt.time_id
    
	JOIN AppleMaps.dim_dp_taskid AS ti
    ON dp.TaskIDs = ti.taskid_dsc
    AND dp.time_id = ti.time_id    
    
    WHERE dp.time_id = varDay;
       
END LOOP getdata;   
CLOSE cur1 ;
    


END ;;
DELIMITER ;
