CREATE DEFINER=`ETL_Admin`@`%` PROCEDURE `sp_dp_purgeday`(date_dat INT(11))
BEGIN

DELETE FROM AppleMaps.fac_dp WHERE time_id = date_dat;
DELETE FROM AppleMaps.dim_dp_rater  WHERE time_id = date_dat;
DELETE FROM AppleMaps.dim_dp_rateremail WHERE time_id = date_dat;
DELETE FROM AppleMaps.dim_dp_primarylocale WHERE time_id = date_dat;
DELETE FROM AppleMaps.dim_dp_locale WHERE time_id = date_dat;
DELETE FROM AppleMaps.dim_dp_concept WHERE time_id = date_dat;
DELETE FROM AppleMaps.dim_dp_conceptname WHERE time_id = date_dat;
DELETE FROM AppleMaps.dim_dp_tasktype WHERE time_id = date_dat;
DELETE FROM AppleMaps.dim_dp_taskid WHERE time_id = date_dat;
DELETE FROM AppleMaps.fac_dp_summary WHERE time_id = date_dat;  

END ;;
