CREATE DEFINER=`ETL_Admin`@`%` PROCEDURE `sp_dp_taskperanalyst_range`(timeidstart_dat INT, timeidend_dat INT)
BEGIN

SELECT r.name_dsc, re.email_dsc, pl.primarylocale_dsc, tt.tasktype_dsc, DATE(CONVERT_TZ(m.finish_dat,'UTC','America/Los_Angeles')) AS EndTime_PST, COUNT(*) AS Number_of_Results, estratingtime_int AS Time_Allocated, m.time_id
FROM AppleMaps.fac_dp AS m
JOIN AppleMaps.dim_dp_rater AS r
ON m.rater_id = r.rater_id
AND r.time_id = m.time_id
JOIN AppleMaps.dim_dp_rateremail AS re
ON m.rateremail_id = re.re_id
AND re.time_id = m.time_id
JOIN AppleMaps.dim_dp_primarylocale AS pl
ON m.plocale_id = pl.pl_id
AND pl.time_id = m.time_id
JOIN AppleMaps.dim_dp_concept AS c
ON m.concept_id = c.c_id
AND c.time_id = m.time_id
JOIN AppleMaps.dim_dp_conceptname AS cn
ON m.conceptname_id = cn.cn_id
AND cn.time_id = m.time_id
JOIN AppleMaps.dim_dp_tasktype AS tt
ON m.tasktype_id = tt.tt_id
AND tt.time_id = m.time_id
LEFT JOIN AppleMaps.dim_dp_nonbillconceptnames AS nbcn
ON cn.conceptname_dsc = nbcn.conceptname_dsc
LEFT JOIN AppleMaps.dim_dp_nonbillbookids AS nbbi
ON m.bookid_int = nbbi.bookid_int
WHERE m.time_id BETWEEN timeidstart_dat AND timeidend_dat
AND nbcn.conceptname_dsc IS NULL
AND nbbi.bookid_int IS NULL
GROUP BY m.rateremail_id, m.plocale_id, m.tasktype_id, m.estratingtime_int;

END ;;
DELIMITER ;
