CREATE DEFINER=`ETL_Admin`@`%` PROCEDURE `sp_dt_import`()
BEGIN

DECLARE finished INTEGER DEFAULT 0;
DECLARE varDay INT(11);
DECLARE varId INT(11);
DECLARE varLocales VARCHAR(5000);


DECLARE cur1 CURSOR FOR
SELECT time_id
FROM AppleMaps.RAW_DailyTasks
GROUP BY time_id;

DECLARE cur2 CURSOR FOR
SELECT Id, Locales
FROM AppleMaps.RAW_DailyTasks
GROUP BY Id, Locales;

DECLARE CONTINUE HANDLER FOR NOT FOUND SET finished = 1;

 DROP TEMPORARY TABLE IF EXISTS AppleMaps.tmpIdLocale;
	CREATE TEMPORARY TABLE AppleMaps.tmpIdLocale (
		id_fk INT DEFAULT NULL,
        time_id INT DEFAULT NULL,
		md5_dsc char(32) COLLATE utf8_unicode_ci NOT NULL,
		locale_dsc  VARCHAR(500) COLLATE utf8_unicode_ci
	) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;


OPEN cur1;
getdata: LOOP
    FETCH cur1 INTO varDay;
		
    IF finished = 1 THEN
		LEAVE getdata;
    END IF;

    CALL AppleMaps.sp_dt_purgeday(varDay);

    # NAME	
    INSERT INTO AppleMaps.dim_dt_name (time_id, md5_dsc, name_dsc)       		
	SELECT time_id, MD5(dt.Name), dt.Name
    FROM AppleMaps.RAW_DailyTasks AS dt	
    WHERE time_id = varDay
    GROUP BY MD5(dt.Name);   
	INSERT INTO AppleMaps.fac_dt_summary (time_id, index_id, rows_id, tbl_dsc)
	SELECT varDay, 1, ROW_COUNT(), 'name';
 
     # ORGANISATION
    INSERT INTO AppleMaps.dim_dt_org (time_id, md5_dsc, organisation_dsc)       		
	SELECT time_id, MD5(dt.Organization), dt.Organization
    FROM AppleMaps.RAW_DailyTasks AS dt	
    WHERE time_id = varDay
    GROUP BY MD5(dt.Organization);   
	INSERT INTO AppleMaps.fac_dt_summary (time_id, index_id, rows_id, tbl_dsc)
	SELECT varDay, 2, ROW_COUNT(), 'organisation';
    
	# PROJECT GROUP
    INSERT INTO AppleMaps.dim_dt_projectgrp (time_id, md5_dsc, projectgroup_dsc)       		
	SELECT time_id, MD5(dt.ProjectGroup), dt.ProjectGroup
    FROM AppleMaps.RAW_DailyTasks AS dt	
    WHERE time_id = varDay
    GROUP BY MD5(dt.ProjectGroup);   
	INSERT INTO AppleMaps.fac_dt_summary (time_id, index_id, rows_id, tbl_dsc)
	SELECT varDay, 3, ROW_COUNT(), 'project group';
 
 	# TASK TYPE
    INSERT INTO AppleMaps.dim_dt_tasktype (time_id, md5_dsc, tasktype_dsc)       		
	SELECT time_id, IFNULL(MD5(dt.TaskType), ''), dt.TaskType
    FROM AppleMaps.RAW_DailyTasks AS dt	
    WHERE time_id = varDay
    GROUP BY IFNULL(MD5(dt.TaskType), '');   
	INSERT INTO AppleMaps.fac_dt_summary (time_id, index_id, rows_id, tbl_dsc)
	SELECT varDay, 4, ROW_COUNT(), 'task type';
 
	# LOCALE
    OPEN cur2;
	getdata2: LOOP
		FETCH cur2 INTO varId, varLocales;
        
		IF finished = 1 THEN
			LEAVE getdata2;
		END IF;
        
		WHILE LOCATE(',', varLocales) > 1 DO    		
            INSERT INTO AppleMaps.tmpIdLocale (id_fk, time_id, md5_dsc, locale_dsc)
			SELECT varId, varDay, MD5(TRIM(SUBSTRING_INDEX(varLocales,',', 1))) AS md5_dsc, TRIM(SUBSTRING_INDEX(varLocales,',', 1)) AS locale_dsc;            
			SET varLocales = REPLACE(varLocales, (SELECT LEFT(varLocales, LOCATE(',', varLocales))),'');        
		END WHILE;
        
        INSERT INTO AppleMaps.tmpIdLocale (id_fk, time_id, md5_dsc, locale_dsc)
		SELECT varId, varDay, MD5(TRIM(SUBSTRING_INDEX(varLocales,',', 1))) AS md5_dsc, TRIM(SUBSTRING_INDEX(varLocales,',', 1)) AS locale_dsc;
    
    END LOOP getdata2;   
	CLOSE cur2 ;
	INSERT INTO AppleMaps.dim_dt_locale (id_fk, time_id, md5_dsc, locale_dsc)
	SELECT id_fk, time_id, md5_dsc, locale_dsc 
    FROM AppleMaps.tmpIdLocale 
    GROUP BY id_fk, time_id, md5_dsc;
	INSERT INTO AppleMaps.fac_dt_summary (time_id, index_id, rows_id, tbl_dsc)
	SELECT varDay, 5, ROW_COUNT(), 'locale';      
    DROP TABLE IF EXISTS AppleMaps.tmpIdLocale;
 
 	# TARGET GROUP
    INSERT INTO AppleMaps.dim_dt_targetgrp (time_id, md5_dsc, targetgroup_dsc)       		
	SELECT time_id, MD5(dt.TargetGroups), dt.TargetGroups
    FROM AppleMaps.RAW_DailyTasks AS dt	
    WHERE time_id = varDay
    GROUP BY MD5(dt.TargetGroups);   
	INSERT INTO AppleMaps.fac_dt_summary (time_id, index_id, rows_id, tbl_dsc)
	SELECT varDay, 6, ROW_COUNT(), 'target group';

 	# SKILL
    INSERT INTO AppleMaps.dim_dt_skill (time_id, md5_dsc, skill_dsc)       		
	SELECT time_id, IFNULL(MD5(dt.Skill), ''), dt.Skill
    FROM AppleMaps.RAW_DailyTasks AS dt	
    WHERE time_id = varDay
    GROUP BY IFNULL(MD5(dt.Skill), '');   
	INSERT INTO AppleMaps.fac_dt_summary (time_id, index_id, rows_id, tbl_dsc)
	SELECT varDay, 7, ROW_COUNT(), 'skill';

	# EXTERNAL RATER GROUP
    INSERT INTO AppleMaps.dim_dt_externalratergrp (time_id, md5_dsc, externalratergroup_dsc)       		
	SELECT time_id, MD5(dt.ExternalRaterGroups), dt.ExternalRaterGroups
    FROM AppleMaps.RAW_DailyTasks AS dt	
    WHERE time_id = varDay
    GROUP BY MD5(dt.ExternalRaterGroups);   
	INSERT INTO AppleMaps.fac_dt_summary (time_id, index_id, rows_id, tbl_dsc)
	SELECT varDay, 8, ROW_COUNT(), 'external rater group';

	# TRUSTED RATER GROUP
    INSERT INTO AppleMaps.dim_dt_trustedratergrp (time_id, md5_dsc, trustedratergroup_dsc)       		
	SELECT time_id, IFNULL(MD5(dt.TrustedRaterGroups),''), dt.TrustedRaterGroups
    FROM AppleMaps.RAW_DailyTasks AS dt	
    WHERE time_id = varDay
    GROUP BY IFNULL(MD5(dt.TrustedRaterGroups),'');   
	INSERT INTO AppleMaps.fac_dt_summary (time_id, index_id, rows_id, tbl_dsc)
	SELECT varDay, 9, ROW_COUNT(), 'trusted rater group';

	# GUIDELINE ID
    INSERT INTO AppleMaps.dim_dt_guidelineid (time_id, guidelineid_dsc)       		
	SELECT time_id, IFNULL(dt.GuidelineId, '')
    FROM AppleMaps.RAW_DailyTasks AS dt	
    WHERE time_id = varDay
    GROUP BY IFNULL(MD5(dt.GuidelineId), '');   
	INSERT INTO AppleMaps.fac_dt_summary (time_id, index_id, rows_id, tbl_dsc)
	SELECT varDay, 10, ROW_COUNT(), 'guideline id';

	# GUIDELINE NAME
    INSERT INTO AppleMaps.dim_dt_guidelinename (time_id, md5_dsc, guidelinename_dsc)       		
	SELECT time_id, IFNULL(MD5(dt.GuidelineName), ''), dt.GuidelineName
    FROM AppleMaps.RAW_DailyTasks AS dt	
    WHERE time_id = varDay
    GROUP BY IFNULL(MD5(dt.GuidelineName), '');   
	INSERT INTO AppleMaps.fac_dt_summary (time_id, index_id, rows_id, tbl_dsc)
	SELECT varDay, 11, ROW_COUNT(), 'guideline name';

   	# PROJECT MATCHING KEY
    INSERT INTO AppleMaps.dim_dt_projectmatchkey (time_id, md5_dsc, projectmkey_dsc)       		
	SELECT time_id, IFNULL(MD5(dt.ProjectMatchingKey), ''), dt.ProjectMatchingKey
    FROM AppleMaps.RAW_DailyTasks AS dt	
    WHERE time_id = varDay
    GROUP BY IFNULL(MD5(dt.ProjectMatchingKey), '');   
	INSERT INTO AppleMaps.fac_dt_summary (time_id, index_id, rows_id, tbl_dsc)
	SELECT varDay, 12, ROW_COUNT(), 'project matching key';
   
	# DAILY TASKS
	INSERT INTO AppleMaps.fac_dt (id_int, name_id, organisation_id, project_id, tasktype_id, locale_id, locale_fk, taskcount_int, ratedpercent_int, completed_int, 
		pending_int, targetgroups_id, state_enu, launched_dat, weight_int, skill_id, skillstate_enu, externalratergrp_id, dynamiccoverage_enu, 
        superrating_enu, trustedratinggrp_id, testquestionsrc_id, guideline_id, guidelinename_id, clusterkey_id, projectmatch_id, createdat_dat, lastupdated_dat, time_id)
    SELECT dt.Id, n.name_id, o.org_id, pg.pgrp_id, tt.tt_id, l.l_id, l.id_fk, dt.TaskCount, CASE WHEN RatedPercent = 'NaN' THEN NULL ELSE RatedPercent END,
		CAST(SUBSTRING_INDEX(dt.CompletedPending, ' /', 1) AS UNSIGNED),
        MID(dt.CompletedPending, INSTR(dt.CompletedPending, '/ ') + 1, 20),
        tg.tg_id, dt.StateEnu, dt.LaunchedAt, dt.Weight, s.skill_id, dt.SkillState, erg.erg_id, dt.DynamicCoverage,
        dt.SuperRating, trg.trg_id, dt.TestQuestionsSource, gid.gl_id, gn.gn_id, dt.ClusterKey, pmk.pmk_id, dt.CreatedAt, dt.LastUpdatedAt, dt.time_id
     
    FROM AppleMaps.RAW_DailyTasks AS dt
    
	JOIN AppleMaps.dim_dt_name AS n
    ON MD5(dt.Name) = n.md5_dsc
    AND dt.time_id = n.time_id
   
   	JOIN AppleMaps.dim_dt_org AS o
    ON MD5(dt.Organization) = o.md5_dsc
    AND dt.time_id = o.time_id
    
	JOIN AppleMaps.dim_dt_projectgrp AS pg
    ON MD5(dt.ProjectGroup) = pg.md5_dsc
    AND dt.time_id = pg.time_id
    
	JOIN AppleMaps.dim_dt_tasktype AS tt
    ON IFNULL(MD5(dt.TaskType),'') = tt.md5_dsc
    AND dt.time_id = tt.time_id
   
    JOIN AppleMaps.dim_dt_locale AS l
    ON dt.Id = l.id_fk
    AND dt.time_id = l.time_id
    
	JOIN AppleMaps.dim_dt_targetgrp AS tg
	ON MD5(dt.TargetGroups) = tg.md5_dsc
    AND dt.time_id = tg.time_id
    
	JOIN AppleMaps.dim_dt_skill AS s
	ON IFNULL(MD5(dt.Skill),'') = s.md5_dsc
    AND dt.time_id = s.time_id
    
	JOIN AppleMaps.dim_dt_externalratergrp AS erg
	ON MD5(dt.ExternalRaterGroups) = erg.md5_dsc
    AND dt.time_id = erg.time_id
    
	JOIN AppleMaps.dim_dt_trustedratergrp AS trg
	ON IFNULL(MD5(dt.TrustedRaterGroups),'') = trg.md5_dsc
    AND dt.time_id = trg.time_id
    
	JOIN AppleMaps.dim_dt_guidelineid AS gid
	ON IFNULL(dt.GuidelineId,'') = gid.guidelineid_dsc
    AND dt.time_id = gid.time_id
    
	JOIN AppleMaps.dim_dt_guidelinename AS gn
	ON IFNULL(MD5(dt.GuidelineName),'') = gn.md5_dsc
