BEGIN

DECLARE finished INTEGER DEFAULT 0;
DECLARE intEpochStart DATETIME;
DECLARE intEpochEnd DATETIME;

DECLARE cur1 CURSOR FOR
SELECT filename_start, filename_end   
FROM AppleMaps.RAW_RCHourly
GROUP BY filename_start, filename_end;

