    CALL AppleMaps.sp_rch_purgeday(intEpochStart, intEpochEnd);

END LOOP getdata;   
CLOSE cur1 ;


INSERT INTO AppleMaps.dim_rch_rater (email_md5, email_dsc, name_md5, name_dsc) 
SELECT RaterEmail_MD5, Rater_Email, RaterName_MD5, Rater_Name
FROM AppleMaps.RAW_RCHourly AS r
LEFT JOIN AppleMaps.dim_rch_rater AS dim
ON r.RaterEmail_MD5 = dim.email_md5
WHERE dim.email_md5 IS NULL
GROUP BY RaterEmail_MD5, RaterName_MD5;

INSERT INTO AppleMaps.dim_rch_primarylocale (pl_md5, primarylocale_dsc, l_md5, locale_dsc)       		
SELECT PrimaryLocale_MD5, PrimaryLocale, Locale_MD5, Locale
FROM AppleMaps.RAW_RCHourly AS r		
LEFT JOIN AppleMaps.dim_rch_primarylocale AS dim
ON r.PrimaryLocale_MD5 = dim.pl_md5
AND r.Locale_MD5 = dim.l_md5
WHERE dim.pl_md5 IS NULL
GROUP BY PrimaryLocale_MD5, Locale_MD5;

INSERT INTO AppleMaps.dim_rch_concept (c_md5, concept_dsc) 
SELECT Concept_MD5, Concept
FROM AppleMaps.RAW_RCHourly AS r
LEFT JOIN AppleMaps.dim_rch_concept AS dim
ON r.Concept_MD5 = dim.c_md5
WHERE dim.c_md5 IS NULL
GROUP BY Concept_MD5;

INSERT INTO AppleMaps.dim_rch_conceptname (cn_md5, conceptname_dsc) 
SELECT ConceptName_MD5, ConceptName
FROM AppleMaps.RAW_RCHourly AS r
LEFT JOIN AppleMaps.dim_rch_conceptname AS dim
ON r.ConceptName_MD5 = dim.cn_md5
WHERE dim.cn_md5 IS NULL
GROUP BY ConceptName_MD5;

INSERT INTO AppleMaps.dim_rch_tasktype (tt_md5, tasktype_dsc) 
SELECT TaskType_MD5, TaskType
FROM AppleMaps.RAW_RCHourly AS r
LEFT JOIN AppleMaps.dim_rch_tasktype AS dim
ON r.TaskType_MD5 = dim.tt_md5
WHERE dim.tt_md5 IS NULL
GROUP BY TaskType_MD5;

INSERT INTO AppleMaps.dim_rch_ratingkey (rk_md5, ratingkey_dsc) 
SELECT RatingKey_MD5, Rating_Key	
FROM AppleMaps.RAW_RCHourly AS r
LEFT JOIN AppleMaps.dim_rch_ratingkey AS dim
ON r.RatingKey_MD5 = dim.rk_md5
WHERE dim.rk_md5 IS NULL
GROUP BY RatingKey_MD5;

INSERT INTO AppleMaps.dim_rch_taskid (taskid_dsc) 
SELECT Task_ID	
FROM AppleMaps.RAW_RCHourly AS r
LEFT JOIN AppleMaps.dim_rch_taskid AS dim
ON r.Task_ID = dim.taskid_dsc
WHERE dim.taskid_dsc IS NULL
GROUP BY Task_ID;

INSERT INTO AppleMaps.dim_rch_question (q_md5, question_dsc) 
SELECT Question_MD5, Question	
FROM AppleMaps.RAW_RCHourly AS r
LEFT JOIN AppleMaps.dim_rch_question AS dim
ON r.Question_MD5 = dim.q_md5
WHERE dim.q_md5 IS NULL
GROUP BY Question_MD5;

INSERT INTO AppleMaps.dim_rch_answer (a_md5, answer_dsc) 
SELECT Answer_MD5, IFNULL(Answer, '')	
FROM AppleMaps.RAW_RCHourly AS r
LEFT JOIN AppleMaps.dim_rch_answer AS dim
ON r.Answer_MD5 = dim.a_md5
WHERE dim.a_md5 IS NULL
GROUP BY Answer_MD5;

INSERT INTO AppleMaps.dim_rch_comment (com_md5, comment_dsc) 
SELECT Comment_MD5, IFNULL(`CommentStr`, '')
FROM AppleMaps.RAW_RCHourly AS r
LEFT JOIN AppleMaps.dim_rch_comment AS dim
ON r.Comment_MD5 = dim.com_md5
WHERE dim.com_md5 IS NULL
GROUP BY Comment_MD5;

INSERT INTO AppleMaps.dim_rch_template (template_dsc) 
SELECT Template
FROM AppleMaps.RAW_RCHourly AS r
LEFT JOIN AppleMaps.dim_rch_template AS dim
ON r.Template = dim.template_dsc
WHERE dim.template_dsc IS NULL
GROUP BY Template;

INSERT INTO AppleMaps.fac_rch (r_id, pl_id, c_id, cn_id, tt_id, bookid_int, requestid_int, tsk_id, rk_id, 
	start_dat, finish_dat, pststart_dat, pstfinish_dat, q_id, a_id, com_id, tem_id, temver_int, replayid_int, filestart_dat, fileend_dat)

SELECT r.r_id, pl.pl_id, c.c_id, cn.cn_id, tt.tt_id, raw.BookId, raw.RequestID, tsk.tsk_id, rk.rk_id, 
	raw.Start_Time, raw.Finish_Time, raw.pststart_dat, raw.pstfinish_dat, q.q_id, a.a_id, com.com_id, tem.t_id, raw.Template_Version, raw.ReplayID,  raw.filename_start, raw.filename_end

FROM AppleMaps.RAW_RCHourly AS raw

JOIN AppleMaps.dim_rch_rater AS r
ON raw.RaterEmail_MD5 = r.email_md5
AND raw.RaterName_MD5 = r.name_md5

JOIN AppleMaps.dim_rch_primarylocale AS pl
ON raw.PrimaryLocale_MD5 = pl.pl_md5
AND raw.Locale_MD5 = pl.l_md5

JOIN AppleMaps.dim_rch_concept AS c
ON raw.Concept_MD5 = c.c_md5

JOIN AppleMaps.dim_rch_conceptname AS cn
ON raw.ConceptName_MD5 = cn.cn_md5

JOIN AppleMaps.dim_rch_tasktype AS tt
ON raw.TaskType_MD5 = tt.tt_md5

JOIN AppleMaps.dim_rch_ratingkey AS rk
ON raw.RatingKey_MD5 = rk.rk_md5

JOIN AppleMaps.dim_rch_taskid AS tsk
ON raw.Task_ID = tsk.taskid_dsc

JOIN AppleMaps.dim_rch_question AS q
ON raw.Question_MD5 = q.q_md5

JOIN AppleMaps.dim_rch_answer AS a
ON raw.Answer_MD5 = a.a_md5

JOIN AppleMaps.dim_rch_comment AS com
ON raw.Comment_MD5 = com.com_md5

JOIN AppleMaps.dim_rch_template AS tem
ON raw.Template = tem.template_dsc;

END ;;
