CREATE DEFINER=`ETL_Admin`@`%` PROCEDURE `sp_rc_import`()
BEGIN

DECLARE finished INTEGER DEFAULT 0;
DECLARE varDay INT(11);
DECLARE intEpochStart INT(11);
DECLARE intEpochEnd INT(11);


DECLARE cur1 CURSOR FOR
SELECT DATE_FORMAT(FROM_UNIXTIME(LEFT(RIGHT(REPLACE(filename, '.csv', ''), 21), 10)), '%Y%m%d'), LEFT(RIGHT(REPLACE(filename, '.csv', ''), 21), 10), RIGHT(REPLACE(filename, '.csv', ''), 10)   
FROM AppleMaps.RAW_RaterComparison
GROUP BY RIGHT(REPLACE(filename, '.csv', ''), 22);

DECLARE CONTINUE HANDLER FOR NOT FOUND SET finished = 1;


OPEN cur1;
getdata: LOOP
    
    FETCH cur1 INTO varDay, intEpochStart, intEpochEnd;
		
    IF finished = 1 THEN
		LEAVE getdata;
    END IF;    
	
    CALL AppleMaps.sp_rc_purgeday(varDay);    
    
    # RATER
	INSERT INTO AppleMaps.dim_rc_rater (time_id, md5_dsc, email_dsc, name_dsc)       		
	SELECT time_id, MD5(r.Rater_Email), r.Rater_Email, r.Rater_Name
    FROM AppleMaps.RAW_RaterComparison AS r 		
    WHERE time_id = varDay
    GROUP BY MD5(r.Rater_Email);   
	INSERT INTO AppleMaps.fac_rc_summary (time_id, epochstart_dat, epochend_dat, index_id, rows_id, tbl_dsc)
	SELECT varDay, intEpochStart, intEpochEnd, 1, ROW_COUNT(), 'rater';
    
    # RATER LOCALE
	INSERT INTO AppleMaps.dim_rc_raterlocale (time_id, md5_dsc, primarylocale_dsc)       		
    SELECT time_id, MD5(PrimaryLocale), PrimaryLocale
    FROM AppleMaps.RAW_RaterComparison AS r 		
    WHERE time_id = varDay
    GROUP BY MD5(PrimaryLocale);                
	INSERT INTO AppleMaps.fac_rc_summary (time_id, epochstart_dat, epochend_dat, index_id, rows_id, tbl_dsc)
	SELECT varDay, intEpochStart, intEpochEnd, 2, ROW_COUNT(), 'locale';
        	
	# CONCEPT
	INSERT INTO AppleMaps.dim_rc_concept (time_id, md5_dsc, concept_dsc)       		
	SELECT time_id, MD5(r.Concept), r.Concept
    FROM AppleMaps.RAW_RaterComparison AS r 		
    WHERE time_id = varDay
    GROUP BY MD5(r.Concept);               
	INSERT INTO AppleMaps.fac_rc_summary (time_id, epochstart_dat, epochend_dat, index_id, rows_id, tbl_dsc)
	SELECT varDay, intEpochStart, intEpochEnd, 3, ROW_COUNT(), 'concept';
        
    # CONCEPT NAME
	INSERT INTO AppleMaps.dim_rc_conceptname (time_id, md5_dsc, conceptname_dsc)       		
	SELECT time_id, MD5(r.ConceptName), r.ConceptName
    FROM AppleMaps.RAW_RaterComparison AS r 		
    WHERE time_id = varDay
    GROUP BY MD5(r.ConceptName);    
	INSERT INTO AppleMaps.fac_rc_summary (time_id, epochstart_dat, epochend_dat, index_id, rows_id, tbl_dsc)
	SELECT varDay, intEpochStart, intEpochEnd, 4, ROW_COUNT(), 'concept name';
	
    # TASK TYPE
	INSERT INTO AppleMaps.dim_rc_tasktype (time_id, md5_dsc, tasktype_dsc)       		
    SELECT time_id, MD5(r.TaskType), r.TaskType
    FROM AppleMaps.RAW_RaterComparison AS r 		
    WHERE time_id = varDay
    GROUP BY MD5(r.TaskType);      
	INSERT INTO AppleMaps.fac_rc_summary (time_id, epochstart_dat, epochend_dat, index_id, rows_id, tbl_dsc)
	SELECT varDay, intEpochStart, intEpochEnd, 5, ROW_COUNT(), 'tasktype';
        	
    # BOOK
	INSERT INTO AppleMaps.dim_rc_book (time_id, book_id)       		
	SELECT time_id, BookId
    FROM AppleMaps.RAW_RaterComparison AS r 		
    WHERE time_id = varDay
    GROUP BY BookId;    
	INSERT INTO AppleMaps.fac_rc_summary (time_id, epochstart_dat, epochend_dat, index_id, rows_id, tbl_dsc)
	SELECT varDay, intEpochStart, intEpochEnd, 6, ROW_COUNT(), 'book id';
        
	# REQUEST ID
	INSERT INTO AppleMaps.dim_rc_request (time_id, request_id)       		
	SELECT time_id, RequestID
    FROM AppleMaps.RAW_RaterComparison AS r 		
    WHERE time_id = varDay
    GROUP BY RequestID;     
	INSERT INTO AppleMaps.fac_rc_summary (time_id, epochstart_dat, epochend_dat, index_id, rows_id, tbl_dsc)
	SELECT varDay, intEpochStart, intEpochEnd, 7, ROW_COUNT(), 'request';
        
    # TASK ID
	INSERT INTO AppleMaps.dim_rc_task (time_id, task_dsc)       		
    SELECT time_id, Task_ID
    FROM AppleMaps.RAW_RaterComparison AS r 		
    WHERE time_id = varDay
    GROUP BY Task_ID;     
	INSERT INTO AppleMaps.fac_rc_summary (time_id, epochstart_dat, epochend_dat, index_id, rows_id, tbl_dsc)
	SELECT varDay, intEpochStart, intEpochEnd, 8, ROW_COUNT(), 'task';
        
    # RATING KEY	
	INSERT INTO AppleMaps.dim_rc_ratingkey (time_id, md5_dsc, ratingkey_dsc)       		
	SELECT time_id, MD5(Rating_Key), Rating_key
    FROM AppleMaps.RAW_RaterComparison AS r 		
    WHERE time_id = varDay
    GROUP BY MD5(Rating_Key);  
	INSERT INTO AppleMaps.fac_rc_summary (time_id, epochstart_dat, epochend_dat, index_id, rows_id, tbl_dsc)
	SELECT varDay, intEpochStart, intEpochEnd, 9, ROW_COUNT(), 'rating key';        
        
	# QUESTION
	INSERT INTO AppleMaps.dim_rc_question (time_id, md5_dsc, question_dsc)       		
	SELECT time_id, MD5(Question), Question
    FROM AppleMaps.RAW_RaterComparison AS r 		
    WHERE time_id = varDay
    GROUP BY MD5(Question);   
	INSERT INTO AppleMaps.fac_rc_summary (time_id, epochstart_dat, epochend_dat, index_id, rows_id, tbl_dsc)
	SELECT varDay, intEpochStart, intEpochEnd, 10, ROW_COUNT(), 'question';
           
    # ANSWER
	INSERT INTO AppleMaps.dim_rc_answer (time_id, md5_dsc, answer_dsc)       		
	SELECT time_id, MD5(Answer), Answer
    FROM AppleMaps.RAW_RaterComparison AS r 		
    WHERE time_id = varDay
    GROUP BY MD5(Answer);       
	INSERT INTO AppleMaps.fac_rc_summary (time_id, epochstart_dat, epochend_dat, index_id, rows_id, tbl_dsc)
	SELECT varDay, intEpochStart, intEpochEnd, 11, ROW_COUNT(), 'answer';
        	    
	# COMMENT
	INSERT INTO AppleMaps.dim_rc_comment (time_id, md5_dsc, comment_dsc)       		
	SELECT time_id, MD5(`Comment`), `Comment`
    FROM AppleMaps.RAW_RaterComparison AS r 		
    WHERE time_id =  varDay
    GROUP BY MD5(`Comment`);        
	INSERT INTO AppleMaps.fac_rc_summary (time_id, epochstart_dat, epochend_dat, index_id, rows_id, tbl_dsc)
	SELECT varDay, intEpochStart, intEpochEnd, 12, ROW_COUNT(), 'comment';
        
	# TEMPLATE
	INSERT INTO AppleMaps.dim_rc_template (time_id, template_dsc)       		
	SELECT time_id, Template
    FROM AppleMaps.RAW_RaterComparison AS r 		
    WHERE time_id =  varDay
    GROUP BY Template;     
	INSERT INTO AppleMaps.fac_rc_summary (time_id, epochstart_dat, epochend_dat, index_id, rows_id, tbl_dsc)
	SELECT varDay, intEpochStart, intEpochEnd, 13, ROW_COUNT(), 'template';
        
	# TEMPLATE VERSION
	INSERT INTO AppleMaps.dim_rc_templatever (time_id, templatever_dsc)       		
	SELECT time_id, Template_Version
    FROM AppleMaps.RAW_RaterComparison AS r 		
    WHERE time_id =  varDay
    GROUP BY Template_Version;     
	INSERT INTO AppleMaps.fac_rc_summary (time_id, epochstart_dat, epochend_dat, index_id, rows_id, tbl_dsc)
	SELECT varDay, intEpochStart, intEpochEnd, 14, ROW_COUNT(), 'template version';
        
	# REPLAY
	INSERT INTO AppleMaps.dim_rc_replay (time_id, replayurl_id)       		
	SELECT time_id, RIGHT(Replay, 9)
    FROM AppleMaps.RAW_RaterComparison AS r 		
    WHERE time_id =  varDay
    GROUP BY RIGHT(Replay, 9);     
	INSERT INTO AppleMaps.fac_rc_summary (time_id, epochstart_dat, epochend_dat, index_id, rows_id, tbl_dsc)
	SELECT varDay, intEpochStart, intEpochEnd, 15, ROW_COUNT(), 'replay url';
        

	# RATER COMPARISON
    INSERT INTO AppleMaps.fac_rc (rater_id, locale_id, concept_id, conceptname_id, tasktype_id, book_id, request_id, task_id, ratingkey_id, starttime_dat, finishtime_dat, question_id, answer_id, comment_id, template_id, templateversion_id, replay_id, time_id)	
	SELECT r.rater_id, rl.rl_id, c.concept_id, cn.conceptname_id, tt.tasktype_id, b.b_id, re.r_id, t.task_id, rk.rk_id, rc.Start_Time, rc.Finish_Time, q.q_id, a.answer_id, co.comment_id, te.template_id, tv.templatever_id, rp.replay_id, rc.time_id     
    FROM AppleMaps.RAW_RaterComparison AS rc 		
	
    JOIN AppleMaps.dim_rc_rater AS r
    ON MD5(rc.Rater_Email) = r.md5_dsc
    AND rc.time_id = r.time_id        

    JOIN AppleMaps.dim_rc_raterlocale AS rl
    ON rc.PrimaryLocale = rl.primarylocale_dsc
	AND rc.time_id = rl.time_id

	JOIN AppleMaps.dim_rc_concept AS c
    ON MD5(rc.Concept) = c.md5_dsc
	AND rc.time_id = c.time_id       

    JOIN AppleMaps.dim_rc_conceptname AS cn
    ON MD5(rc.ConceptName) = cn.md5_dsc
    AND rc.time_id = cn.time_id

	JOIN AppleMaps.dim_rc_tasktype AS tt
    ON MD5(rc.TaskType) = tt.md5_dsc
    AND rc.time_id = tt.time_id      

	JOIN AppleMaps.dim_rc_book AS b
    ON rc.BookId = b.book_id
	AND rc.time_id = b.time_id            

	JOIN AppleMaps.dim_rc_request AS re
    ON rc.RequestID = re.request_id
    AND rc.time_id = re.time_id		

    JOIN AppleMaps.dim_rc_task AS t
    ON rc.Task_ID = t.task_dsc
	AND rc.time_id = t.time_id

    JOIN AppleMaps.dim_rc_ratingkey AS rk
    ON MD5(rc.Rating_Key) = rk.md5_dsc
	AND rc.time_id = rk.time_id

	JOIN AppleMaps.dim_rc_question AS q
    ON MD5(rc.Question) = q.md5_dsc
	AND rc.time_id = q.time_id   

    JOIN AppleMaps.dim_rc_answer AS a
    ON IF(ISNULL(rc.Answer), '', MD5(rc.Answer)) = a.md5_dsc
	AND rc.time_id = a.time_id        
    
    JOIN AppleMaps.dim_rc_comment AS co
    ON IF(ISNULL(rc.`Comment`), '', MD5(rc.`Comment`)) = co.md5_dsc
	AND rc.time_id = co.time_id
	
    JOIN AppleMaps.dim_rc_template AS te
    ON rc.Template = te.template_dsc
	AND rc.time_id = te.time_id
    
    JOIN AppleMaps.dim_rc_templatever AS tv
    ON rc.Template_Version = tv.templatever_dsc
	AND rc.time_id = tv.time_id
	
    JOIN AppleMaps.dim_rc_replay AS rp
    ON RIGHT(rc.Replay, 9) = rp.replayurl_id
	AND rc.time_id = rp.time_id    
   
	WHERE rc.time_id = varDay;    
    
    INSERT INTO AppleMaps.fac_rc_summary (time_id, epochstart_dat, epochend_dat, index_id, rows_id, tbl_dsc)
	SELECT varDay, intEpochStart, intEpochEnd, 16, ROW_COUNT(), 'ratercomparison';
       

END LOOP getdata;   
CLOSE cur1 ;

END ;;
DELIMITER ;
