CREATE DEFINER=`ETL_Admin`@`%` PROCEDURE `sp_rc_purgeday`(date_dat INT(11))
BEGIN

DELETE FROM AppleMaps.fac_rc WHERE time_id = date_dat;
DELETE FROM AppleMaps.dim_rc_answer WHERE time_id = date_dat;
DELETE FROM AppleMaps.dim_rc_book WHERE time_id = date_dat;
DELETE FROM AppleMaps.dim_rc_comment WHERE time_id = date_dat;
DELETE FROM AppleMaps.dim_rc_concept WHERE time_id = date_dat;
DELETE FROM AppleMaps.dim_rc_conceptname WHERE time_id = date_dat;
DELETE FROM AppleMaps.dim_rc_question WHERE time_id = date_dat;
DELETE FROM AppleMaps.dim_rc_rater WHERE time_id = date_dat;
DELETE FROM AppleMaps.dim_rc_raterlocale WHERE time_id = date_dat;
DELETE FROM AppleMaps.dim_rc_ratingkey WHERE time_id = date_dat;
DELETE FROM AppleMaps.dim_rc_replay WHERE time_id = date_dat;
DELETE FROM AppleMaps.dim_rc_request WHERE time_id = date_dat;
DELETE FROM AppleMaps.dim_rc_task WHERE time_id = date_dat;
DELETE FROM AppleMaps.dim_rc_tasktype WHERE time_id = date_dat;
DELETE FROM AppleMaps.dim_rc_template WHERE time_id = date_dat;
DELETE FROM AppleMaps.dim_rc_templatever WHERE time_id = date_dat;
DELETE FROM AppleMaps.fac_rc_summary WHERE time_id = date_dat;    
 

END ;;
