END LOOP getdata;   
CLOSE cur16;

SET finished = 0;

OPEN cur17;
getdata: LOOP    
    FETCH cur17 INTO varDay;		
    IF finished = 1 THEN
		LEAVE getdata;
    END IF;    
    DELETE FROM AppleMaps.fac_rc_summary_3mt WHERE time_id = varDay;
END LOOP getdata;   
