		LEAVE getdata;
    END IF;
    
    DELETE FROM AppleMaps.fac_rfs WHERE filestart_dat = datStart AND fileend_dat = datEnd;
	
END LOOP getdata;   
CLOSE cur1 ;
  
# PROJECT GROUP NAME
INSERT INTO AppleMaps.dim_rfs_projectgroupname (md5_dsc, projectgroupname_dsc)       		
SELECT MD5(r.ProjectGroupName), r.ProjectGroupName
FROM AppleMaps.RAW_RatingFieldScore AS r 	
LEFT JOIN AppleMaps.dim_rfs_projectgroupname AS d
ON MD5(r.ProjectGroupName) = d.md5_dsc
WHERE d.md5_dsc IS NULL
GROUP BY MD5(r.ProjectGroupName);   
	
# PROJECT NAME
INSERT INTO AppleMaps.dim_rfs_projectname (md5_dsc, projectname_dsc)       		
SELECT MD5(r.ProjectName), r.ProjectName
FROM AppleMaps.RAW_RatingFieldScore AS r 		
LEFT JOIN AppleMaps.dim_rfs_projectname AS d
ON MD5(r.ProjectName) = d.md5_dsc
WHERE d.md5_dsc IS NULL
GROUP BY MD5(r.ProjectName);   

# RATER
INSERT INTO AppleMaps.dim_rfs_rater (md5_dsc, email_dsc)       		
SELECT MD5(r.RaterEmail), r.RaterEmail
FROM AppleMaps.RAW_RatingFieldScore AS r 	
LEFT JOIN AppleMaps.dim_rfs_rater AS d
ON MD5(r.RaterEmail) = d.md5_dsc
WHERE d.md5_dsc IS NULL
GROUP BY MD5(r.RaterEmail);   
	        
# PRIMARY LOCALE
INSERT INTO AppleMaps.dim_rfs_primarylocale (md5_dsc, primarylocale_dsc)       		
SELECT MD5(r.PrimaryLocale), r.PrimaryLocale
FROM AppleMaps.RAW_RatingFieldScore AS r 		
LEFT JOIN AppleMaps.dim_rfs_primarylocale AS d
ON MD5(r.PrimaryLocale) = d.md5_dsc
WHERE d.md5_dsc IS NULL
GROUP BY MD5(r.PrimaryLocale);   

# TEST QUESTION ID
INSERT INTO AppleMaps.dim_rfs_testq (md5_dsc, testqid_dsc)       		
SELECT MD5(r.TestQuestionId), r.TestQuestionId
FROM AppleMaps.RAW_RatingFieldScore AS r 		
LEFT JOIN AppleMaps.dim_rfs_testq AS d
ON MD5(r.TestQuestionId) = d.md5_dsc
WHERE d.md5_dsc IS NULL
GROUP BY MD5(r.TestQuestionId);

# TEST QUESTION STATE
INSERT INTO AppleMaps.dim_rfs_testqstate (testquestionstate_enu)       		
SELECT r.TestQuestionState
FROM AppleMaps.RAW_RatingFieldScore AS r 		
LEFT JOIN AppleMaps.dim_rfs_testqstate AS d
ON r.TestQuestionState = d.testquestionstate_enu
WHERE d.testquestionstate_enu IS NULL
GROUP BY r.TestQuestionState;
    
# RATING FIELD
INSERT INTO AppleMaps.dim_rfs_ratingfield (md5_dsc, ratingfield_dsc)       		
SELECT MD5(r.RatingField), r.RatingField
FROM AppleMaps.RAW_RatingFieldScore AS r 		
LEFT JOIN AppleMaps.dim_rfs_ratingfield AS d
ON MD5(r.RatingField) = d.md5_dsc
