# EXPECTED ANSWER
INSERT INTO AppleMaps.dim_rfs_expectedanswer (md5_dsc, expectedanswer_dsc)       		
SELECT IFNULL(MD5(r.ExpectedAnswer),''), r.ExpectedAnswer
FROM AppleMaps.RAW_RatingFieldScore AS r 		
LEFT JOIN AppleMaps.dim_rfs_expectedanswer AS d
ON IFNULL(MD5(r.ExpectedAnswer), '') = d.md5_dsc
WHERE d.md5_dsc IS NULL
GROUP BY IFNULL(MD5(r.ExpectedAnswer),'');   

# RATER ANSWER
INSERT INTO AppleMaps.dim_rfs_rateranswer (md5_dsc, rateranswer_dsc)       		
SELECT IFNULL(MD5(r.RaterAnswer),''), r.RaterAnswer
FROM AppleMaps.RAW_RatingFieldScore AS r 		
LEFT JOIN AppleMaps.dim_rfs_rateranswer AS d
ON IFNULL(MD5(r.RaterAnswer), '') = d.md5_dsc
WHERE d.md5_dsc IS NULL
