WHERE d.md5_dsc IS NULL
GROUP BY IFNULL(MD5(r.CommentStr),'');  


# RATING FIELD SCORE
INSERT INTO AppleMaps.fac_rfs (pgn_id, pn_id, projectid_int, r_id, pl_id, tq_id, tqs_id, rf_id, ea_id, ra_id, s_id, points_int, c_id, submitted_dat, calculated_dat, filestart_dat, fileend_dat)	
SELECT pgn.pgn_id, pn.pn_id, rfs.ProjectId, r.r_id, l.pl_id, tq.tq_id, tqs.tqs_id, rf.rf_id, ea.ea_id, ra.ra_id, s.s_id, rfs.Points, c.c_id, rfs.Submitted, rfs.Calculated, rfs.fnstart_dat, rfs.fnend_dat
FROM AppleMaps.RAW_RatingFieldScore AS rfs 		    
JOIN AppleMaps.dim_rfs_projectgroupname AS pgn
ON MD5(rfs.ProjectGroupName) = pgn.md5_dsc
JOIN AppleMaps.dim_rfs_projectname AS pn
ON MD5(rfs.ProjectName) = pn.md5_dsc
JOIN AppleMaps.dim_rfs_rater AS r
ON MD5(rfs.RaterEmail) = r.md5_dsc
JOIN AppleMaps.dim_rfs_primarylocale AS l
ON MD5(rfs.PrimaryLocale) = l.md5_dsc
JOIN AppleMaps.dim_rfs_testq AS tq
ON MD5(rfs.TestQuestionId) = tq.md5_dsc
JOIN AppleMaps.dim_rfs_testqstate AS tqs
ON rfs.TestQuestionState =  tqs.testquestionstate_enu
JOIN AppleMaps.dim_rfs_ratingfield AS rf
ON MD5(rfs.RatingField) = rf.md5_dsc
JOIN AppleMaps.dim_rfs_expectedanswer AS ea
ON IFNULL(MD5(rfs.ExpectedAnswer),'') = ea.md5_dsc
JOIN AppleMaps.dim_rfs_rateranswer AS ra
ON IFNULL(MD5(rfs.RaterAnswer),'') = ra.md5_dsc
JOIN AppleMaps.dim_rfs_status AS s
ON rfs.StatusEnu = s.status_dsc
JOIN AppleMaps.dim_rfs_comment AS c
ON IFNULL(MD5(rfs.CommentStr), '') = c.md5_dsc;
       


