SELECT rfs.pgn_id, rfs.pn_id, rfs.projectid_int, rfs.r_id, rfs.pl_id, rfs.tq_id, rfs.tqs_id, rfs.rf_id, rfs.ea_id, rfs.ra_id, rfs.s_id, rfs.points_int, rfs.c_id, rfs.submitted_dat, rfs.calculated_dat
FROM AppleMaps.fac_rfs AS rfs
JOIN AppleMaps.fac_rfs_calcdatemax AS rfsmax
ON rfs.calculated_dat = rfsmax.calculated_dat
AND rfs.r_id = rfsmax.r_id
AND rfs.tq_id = rfsmax.tq_id;

