CREATE DEFINER=`ETL_Admin`@`%` PROCEDURE `sp_rm_import`()
BEGIN

DECLARE finished INTEGER DEFAULT 0;
DECLARE varDay INT(11);
DECLARE intEpochStart INT(11);
DECLARE intEpochEnd INT(11);


DECLARE cur1 CURSOR FOR
SELECT time_id 
FROM AppleMaps.RAW_RaterMetrics 
GROUP BY time_id;

DECLARE CONTINUE HANDLER FOR NOT FOUND SET finished = 1;


OPEN cur1;
getdata: LOOP
    FETCH cur1 INTO varDay;
		
    IF finished = 1 THEN
		LEAVE getdata;
    END IF;
    		
    CALL AppleMaps.sp_rm_purgeday(varDay);
  
END LOOP getdata;   
CLOSE cur1 ;


# PROJECT GROUP NAME
INSERT INTO AppleMaps.dim_rm_projectgroupname (time_id, md5_dsc, projectgroupname_dsc)       		
SELECT time_id, MD5(rm.ProjectGroupName), rm.ProjectGroupName
FROM AppleMaps.RAW_RaterMetrics AS rm 		
WHERE time_id = varDay
GROUP BY MD5(rm.ProjectGroupName);   
    
# PROJECT NAME
INSERT INTO AppleMaps.dim_rm_projectname (time_id, md5_dsc, projectname_dsc)       		
SELECT time_id, MD5(rm.ProjectName), rm.ProjectName
FROM AppleMaps.RAW_RaterMetrics AS rm 		
WHERE time_id = varDay
GROUP BY MD5(rm.ProjectName);   

# RATER
INSERT INTO AppleMaps.dim_rm_rater (time_id, md5_dsc, email_dsc)       		
SELECT time_id, MD5(rm.RaterEmail), rm.RaterEmail
FROM AppleMaps.RAW_RaterMetrics AS rm	
WHERE time_id = varDay
GROUP BY MD5(rm.RaterEmail);   

# PRIMARY LOCALE
INSERT INTO AppleMaps.dim_rm_primarylocale (time_id, md5_dsc, primarylocale_dsc)       		
SELECT time_id, MD5(rm.PrimaryLocale), rm.PrimaryLocale
FROM AppleMaps.RAW_RaterMetrics AS rm 		
WHERE time_id = varDay
GROUP BY MD5(rm.PrimaryLocale);   

# RATER STATE
INSERT INTO AppleMaps.dim_rm_raterstate (time_id, raterstate_dsc)       		
SELECT time_id, rm.RaterState
FROM AppleMaps.RAW_RaterMetrics AS rm 		
WHERE time_id = varDay
GROUP BY rm.RaterState;

# TEST STATUS
INSERT INTO AppleMaps.dim_rm_teststatus (time_id, status_dsc)       		
SELECT time_id, rm.TestStatus
FROM AppleMaps.RAW_RaterMetrics AS rm 		
WHERE time_id = varDay
GROUP BY rm.TestStatus;   
   
# TEST FAILURE REASON
INSERT INTO AppleMaps.dim_rm_testfailurereason (time_id, md5_dsc, failreason_dsc)       		
SELECT time_id, IFNULL(MD5(rm.TestFailureReason),''), rm.TestFailureReason
FROM AppleMaps.RAW_RaterMetrics AS rm 		
WHERE time_id = varDay
GROUP BY IFNULL(MD5(rm.TestFailureReason),'');   
  
# QUALIFICATION TEST STATUS
INSERT INTO AppleMaps.dim_rm_qualteststatus (time_id, qtstatus_dsc)       		
SELECT time_id, rm.QualificationTestStatus
FROM AppleMaps.RAW_RaterMetrics AS rm 		
WHERE time_id = varDay
GROUP BY rm.QualificationTestStatus;   

# QUALIFICATION FAILURE REASON
INSERT INTO AppleMaps.dim_rm_qualfailurereason (time_id, md5_dsc, qfailreason_dsc)       		
SELECT time_id, IFNULL(MD5(rm.QualificationFailureReason),''), rm.QualificationFailureReason
FROM AppleMaps.RAW_RaterMetrics AS rm
WHERE time_id = varDay
GROUP BY IFNULL(MD5(rm.QualificationFailureReason),'');   

# PREVIOUS STATUS
INSERT INTO AppleMaps.dim_rm_previousstatus (time_id, md5_dsc, pstatus_dsc)       		
SELECT time_id, IFNULL(MD5(rm.PreviousStatus), ''), rm.PreviousStatus
FROM AppleMaps.RAW_RaterMetrics AS rm 		
WHERE time_id = varDay
GROUP BY IFNULL(MD5(rm.PreviousStatus), '');  

# STATUS UPDATE REASON
INSERT INTO AppleMaps.dim_rm_statusupdreason (time_id, md5_dsc, statusupdreason_dsc)       		
SELECT time_id, IFNULL(MD5(rm.StatusUpdateReason), ''), rm.StatusUpdateReason
FROM AppleMaps.RAW_RaterMetrics AS rm 		
WHERE time_id = varDay
GROUP BY IFNULL(MD5(rm.StatusUpdateReason),'');  


# FACT
INSERT INTO AppleMaps.fac_rm (pgn_id, pn_id, projectid_int, rater_id, plocale_id, raterstate_id, teststatus_id, testfailreason_id, scorepc_int, qualteststatus_id, qualfailreason_id, qtthreshold_int, passedp_int, failedp_int, 
	releasedp_int, submittedp_int, passedqtp_int,  failedqtp_int, releasedqtp_int, submittedqtp_int, totalpossqtp_int, passedgtp_int, failedgtp_int, releasedgtp_int, submittedgtp_int, lastrated_dat, pstatus_id, sur_id, time_id)

SELECT pgn.pgn_id, pn.pn_id, rm.ProjectId, r.rater_id, l.pl_id, rs.rs_id, ts.status_id, tfr.tfr_id, rm.ScorePercentage, qts.qts_id, qfr.qfr_id,
		rm.QTThresholdScorePercentage, rm.PassedPoints, rm.FailedPoints, rm.ReleasedPoints, rm.SubmittedPoints, rm.PassedQTPoints, 
        rm.FailedQTPoints, rm.ReleasedQTPoints, rm.SubmittedQTPoints, rm.TotalPossibleQTPoints, rm.PassedGTPoints, rm.FailedGTPoints, 
        rm.ReleasedGTPoints, rm.SubmittedGTPoints, rm.LastRated, ps.ps_id, sur.sur_id, rm.time_id
FROM AppleMaps.RAW_RaterMetrics AS rm 		
    
JOIN AppleMaps.dim_rm_projectgroupname AS pgn
ON MD5(rm.ProjectGroupName) = pgn.md5_dsc
AND rm.time_id = pgn.time_id
   
JOIN AppleMaps.dim_rm_projectname AS pn
ON MD5(rm.ProjectName) = pn.md5_dsc
AND rm.time_id = pn.time_id       

JOIN AppleMaps.dim_rm_rater AS r
ON MD5(rm.RaterEmail) = r.md5_dsc
AND rm.time_id = r.time_id 

JOIN AppleMaps.dim_rm_primarylocale AS l
ON MD5(rm.PrimaryLocale) = l.md5_dsc
AND rm.time_id = l.time_id   
   
JOIN AppleMaps.dim_rm_raterstate AS rs
ON MD5(rm.RaterState) = MD5(rs.raterstate_dsc)
AND rm.time_id = rs.time_id 

JOIN AppleMaps.dim_rm_teststatus AS ts
ON MD5(rm.TestStatus) = MD5(ts.status_dsc)
AND rm.time_id = ts.time_id   
        
JOIN AppleMaps.dim_rm_testfailurereason AS tfr
ON IFNULL(MD5(rm.TestFailureReason),'') = tfr.md5_dsc
AND rm.time_id = tfr.time_id  
  
JOIN AppleMaps.dim_rm_qualteststatus AS qts
ON MD5(rm.QualificationTestStatus) = MD5(qts.qtstatus_dsc)
AND rm.time_id = qts.time_id   
    
JOIN AppleMaps.dim_rm_qualfailurereason AS qfr
ON IFNULL(MD5(rm.QualificationFailureReason),'') = qfr.md5_dsc
AND rm.time_id = qfr.time_id  
  
JOIN AppleMaps.dim_rm_previousstatus AS ps
ON IFNULL(MD5(rm.PreviousStatus),'') = ps.md5_dsc
AND rm.time_id = ps.time_id  
  
JOIN AppleMaps.dim_rm_statusupdreason AS sur
ON IFNULL(MD5(rm.StatusUpdateReason),'') = sur.md5_dsc
AND rm.time_id = sur.time_id;
 
   

END ;;
