CREATE DEFINER=`ETL_Admin`@`%` PROCEDURE `sp_rm_importhistory`()
BEGIN

DECLARE finished INTEGER DEFAULT 0;
DECLARE varMD5Rater CHAR(32);


DECLARE cur1 CURSOR FOR
SELECT md5_dsc 
FROM AppleMaps.dim_rm_rater 
GROUP BY md5_dsc;

DECLARE CONTINUE HANDLER FOR NOT FOUND SET finished = 1;


OPEN cur1;
getdata: LOOP
    FETCH cur1 INTO varMD5Rater;
		
    IF finished = 1 THEN
		LEAVE getdata;
    END IF;
    		
      
	# PROJECT GROUP NAME
    INSERT INTO AppleMaps.fac_rm_history (start_dat, end_dat, pgn_id, pn_id, project_id, rater_id, plocale_id, raterstate_id, teststatus_id, testfailreason_id, scorepc_int, 
		qualteststatus_id, qualfailreason_id, qtthreshold_int, pstatus_id, passedp_int, failedp_int, releasedp_int, submittedp_int, passedqtp_int, failedqtp_int, releasedqtp_int, 
		passedgtp_int, failedgtp_int, submittedgtp_int, submittedqtp_int, totalpossqtp_int, releasedgtp_int, sur_id, lastrated_dat, created_dat)
	
    SELECT MIN(rm.time_id), MAX(rm.time_id), pgn.pgn_id, pn.pn_id, rm.project_id, r.rater_id, pl.pl_id, rs.rs_id, ts.status_id, tfr.tfr_id,
		rm.scorepc_int, qts.qts_id, qfr.qfr_id, rm.qtthreshold_int, ps.ps_id, rm.passedp_int, rm.failedp_int, rm.releasedp_int, rm.submittedp_int, rm.passedqtp_int, rm.failedqtp_int, rm.releasedqtp_int,
		rm.passedgtp_int, rm.failedgtp_int, rm.submittedgtp_int, rm.submittedqtp_int, rm.totalpossqtp_int, rm.releasedgtp_int, rm.sur_id, rm.lastrated_dat, rm.created_dat
   
	FROM AppleMaps.fac_rm AS rm

	JOIN AppleMaps.dim_rm_rater AS r
	ON rm.rater_id = r.rater_id
	AND rm.time_id = r.time_id

	JOIN AppleMaps.dim_rm_projectgroupname AS pgn
	ON rm.pgn_id = pgn.pgn_id
	AND rm.time_id = pgn.time_id

	JOIN AppleMaps.dim_rm_projectname AS pn
	ON rm.pn_id = pn.pn_id
	AND rm.time_id = pn.time_id

	JOIN AppleMaps.dim_rm_primarylocale AS pl
	ON rm.plocale_id = pl.pl_id
	AND rm.time_id = pl.time_id

	JOIN AppleMaps.dim_rm_raterstate AS rs
	ON rm.raterstate_id = rs.rs_id
	AND rm.time_id = rs.time_id

	JOIN AppleMaps.dim_rm_teststatus AS ts
	ON rm.teststatus_id = ts.status_id
	AND rm.time_id = ts.time_id

	JOIN AppleMaps.dim_rm_testfailurereason AS tfr
	ON rm.testfailreason_id = tfr.tfr_id
	AND rm.time_id = ts.time_id

	JOIN AppleMaps.dim_rm_qualfailurereason AS qfr
	ON rm.qualfailreason_id = qfr.qfr_id
	AND rm.time_id = ts.time_id

	JOIN AppleMaps.dim_rm_qualteststatus AS qts
	ON rm.qualteststatus_id = qts.qts_id
	AND rm.time_id = ts.time_id

	JOIN AppleMaps.dim_rm_previousstatus AS ps
	ON rm.pstatus_id = ps.ps_id
	AND rm.time_id = ps.time_id

	JOIN AppleMaps.dim_rm_statusupdreason AS sur
	ON rm.sur_id = sur.sur_id
	AND rm.time_id = ps.time_id
	WHERE r.md5_dsc = varMD5Rater

	GROUP BY r.md5_dsc, pgn.md5_dsc, pn.md5_dsc, rm.project_id, rs.raterstate_dsc, ts.status_dsc, tfr.md5_dsc, rm.scorepc_int, qfr.md5_dsc, qts.qtstatus_dsc, rm.qtthreshold_int, rm.passedp_int, rm.failedp_int, ps.md5_dsc, sur.md5_dsc;

    
END LOOP getdata;   
CLOSE cur1 ;

END ;;
