CREATE DEFINER=`ITCHaynes_Admin`@`%` PROCEDURE `sp_rm_purgeday`(date_dat INT(11))
BEGIN

DELETE FROM AppleMaps.fac_rm WHERE time_id = date_dat;
DELETE FROM AppleMaps.dim_rm_previousstatus WHERE time_id = date_dat;
DELETE FROM AppleMaps.dim_rm_primarylocale  WHERE time_id = date_dat;
