CREATE DEFINER=`ETL_Admin`@`%` PROCEDURE `sp_sk_import`()
BEGIN

DECLARE finished INTEGER DEFAULT 0;
DECLARE varDay INT(11);

DECLARE cur1 CURSOR FOR
SELECT filedate_dat 
FROM AppleMaps.RAW_Skills
GROUP BY filedate_dat;

DECLARE CONTINUE HANDLER FOR NOT FOUND SET finished = 1;


OPEN cur1;
getdata: LOOP
    FETCH cur1 INTO varDay;
		
    IF finished = 1 THEN
		LEAVE getdata;
    END IF;
		
    CALL AppleMaps.sp_sk_purgeday(varDay);  

END LOOP getdata;   
CLOSE cur1 ;


# NAME
INSERT INTO AppleMaps.dim_sk_name (name_dsc)       		
SELECT sk.`name`
FROM AppleMaps.RAW_Skills AS sk
LEFT JOIN AppleMaps.dim_sk_name AS dim
ON sk.name_MD5 = dim.name_md5
WHERE dim.name_md5 IS NULL
GROUP BY sk.name_MD5;   

# DESCRIPTION
INSERT INTO AppleMaps.dim_sk_description (description_dsc)       		
SELECT  sk.`description`
FROM AppleMaps.RAW_Skills AS sk	
LEFT JOIN AppleMaps.dim_sk_description AS dim
ON sk.desc_MD5 = dim.desc_md5
WHERE dim.desc_md5 IS NULL
GROUP BY sk.desc_MD5;
    
# TEST QUESTION SET
INSERT INTO AppleMaps.dim_sk_testquestionset (testquestionset_dsc)       		
SELECT sk.testQuestionSets
FROM AppleMaps.RAW_Skills AS sk	
LEFT JOIN AppleMaps.dim_sk_testquestionset AS dim
ON sk.testqset_md5 = dim.testqset_md5
WHERE dim.testqset_md5 IS NULL
GROUP BY sk.testqset_md5;  

# FACT
INSERT INTO AppleMaps.fac_sk (id_int, n_id, d_id, projectgroup_int, org_int, state_enu, createdby_int, createdon_dat, updatedby_int, updated_dat, tqs_id, tqs_int, filedate_dat)     
SELECT sk.id, n.n_id, d.d_id, sk.projectGroupId, sk.organizationId, sk.`State`, sk.createdBy, DATE_FORMAT(CONCAT(LEFT(created, 10), ' ', MID(created, 12,8)),'%Y/%m/%d %H:%i:%s'),
	sk.updatedBy, DATE_FORMAT(CONCAT(LEFT(updated, 10), ' ', MID(updated, 12,8)),'%Y/%m/%d %H:%i:%s'), tqs.tqs_id, 	
	CASE 
		WHEN tqs.testquestionset_dsc = '[]' THEN NULL 
		ELSE MID(tqs.testquestionset_dsc, 24,7)
	END AS`testqset_id`, sk.filedate_dat
FROM AppleMaps.RAW_Skills AS sk   
JOIN AppleMaps.dim_sk_name AS n
ON sk.name_md5 = n.name_md5
JOIN AppleMaps.dim_sk_description AS d
ON sk.desc_md5 = d.desc_md5
JOIN AppleMaps.dim_sk_testquestionset AS tqs
ON sk.testqset_md5 = tqs.testqset_md5;
    

END ;;
